import logo from './logo.svg';
import './App.css';
import Home from './pages/home'
import Layout from './components/layout';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <Router>
    <layout>
      <Routes>
      <Route path="/" element={<Home />} />
      </Routes>
    </layout>
    </Router>
  )
}

export default App;
